import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

function OfferSuccessModal() {
    return (
        <Modal.Dialog>
            <Modal.Header closeButton>
                <Modal.Title>Offer has been requested successfully</Modal.Title>
            </Modal.Header>

            <Modal.Body>
                <p>Please wait for the seller's response to you.</p>
            </Modal.Body>

            <Modal.Footer>
                <Button variant="secondary">Close</Button>
            </Modal.Footer>
        </Modal.Dialog>
    );
}

export default OfferSuccessModal;
